import React from "react";
import { FaShoppingCart } from "react-icons/fa";
import logoImg from "../assets/logos.jpg"

const Header = () => {
    return(
        <header style={styles.header}>
            <div style={styles.logo}>
                <img src={logoImg} alt="" style={styles.logoImg} />

            </div>
            <input type="text" placeholder="Search for Products..." style={styles.searchBar}/>
            <nav style={styles.nav}>
                <a href="/">Shop by Category</a>
                <a href="/">Exotic Fruits</a>
                <a href="/">Fruits & Vegetables</a>
                <a href="/">Groceries</a>
                <a href="/">Beverages</a>
                
                <button style={styles.login}>Login /Sign Up</button>
                <FaShoppingCart size={20} color="black" style={{marginLeft:"auto"}}/>

            </nav>
        </header>
    );
};
 const styles ={
    header:{display:"flex",justifyContent:"space-between",alignItems:"center",padding:"10px",background:"#E6EE9C",height:"170px"},
    logoImg:{width:"105px",position:"relative",left:"16px",bottom:"3px"},
    searchBar:{margin:"0,10px",padding:"10px",border:"1px solid #ccc", borderRadius:"7px",left:"24px",position:"relative",height:"33px",width:"620px"},
    nav:{display:"flex",gap:"15px",alignItems:"center",textDecoration:"none"},
    login:{background:"#000",color:"#fff",padding:"5px 10px",borderRadius:"5px"},
   


 };




export default Header;
